import './customButtons';

import { Button } from '@mui/material';
const CustomButton = () => {
    return (
        <>
            <Button variant="contained">login</Button>
            <p>Become a Seller</p>
            <p>Become a Seller</p>
            <div></div>
        </>
    );
};

export default CustomButton;
